import React, {Component} from "react";
import { Link, animateScroll as scroll } from "react-scroll";
import {Container, Navbar, Nav} from "react-bootstrap";
import {translate} from "react-switch-lang"
import logo from "./logoKancelar.png"
import "./Header.css"
//import {Container} from "react-bootstrap";

class Headers extends Component {
    scrollToTop = () => {
        scroll.scrollToTop();
    };

    render() {
    const {t} = this.props;
           return (
            <Navbar sticky="top" className="nav">
                <Navbar.Brand href="#home"></Navbar.Brand>
                <Navbar.Toggle aria-controls="responsive-navbar-nav" />
                <Navbar.Collapse id="responsive-navbar-nav">
                    <Nav className="mr-auto">
                        <Nav.Link><Link
                            activeClass="active"
                            to="section1"
                            spy={true}
                            href="#home"
                            smooth={true}
                            offset={-70}
                            duration={800}
                        >{t('header.section1.title')}</Link></Nav.Link>
                        <Nav.Link><Link
                            activeClass="active"
                            to="section2"
                            spy={true}
                            href="#section2"
                            smooth={true}
                            offset={-70}
                            duration={800}
                        >{t('header.section2.title')}</Link></Nav.Link>
                            <Nav.Link><Link
                                activeClass="active"
                                to="section3"
                                spy={true}
                                href="#section3"
                                smooth={true}
                                offset={-70}
                                duration={800}
                            >{t('header.section3.title')}</Link></Nav.Link>
                        <Nav.Link><Link
                            activeClass="active"
                            to="section4"
                            spy={true}
                            href="#section4"
                            smooth={true}
                            offset={-70}
                            duration={800}
                        >{t('header.section4.title')}</Link></Nav.Link>
                        <Nav.Link><Link
                            activeClass="active"
                            to="section5"
                            spy={true}
                            href="#section5"
                            smooth={true}
                            offset={-70}
                            duration={800}
                        >{t('header.section5.title')}</Link></Nav.Link>
                    </Nav>
                </Navbar.Collapse>
            </Navbar>

           )
    }
}


export default translate(Headers);

